const userNotes = [{
  id: 1,
  title: "Just a note",
  content: "It is just a note. No big deal."
}, {
  id: 2,
  name: "Miley Cyrus",
  title: "Knock Knock",
  content: "Hello. I have a question. Is there someone knocking on the door?"
}, {
  id: 3,
  title: "Welcome Back",
  content: "She came back from America, and honestly speaking, she didn't like the place there."
}, {
  id: 4,
  title: "Another dummy note",
  content: "Nothing to write here; it is just another note for testing purposes."
}];

export default userNotes;
